import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Number from "./Number.js";
import Operation from "./Operation.js";

const App = () => {
  let arr = [
    ["AC", "+/-", "%", "รท"],
    ["7", "8", "9", "x"],
    ["4", "5", "6", "-"],
    ["1", "2", "3", "+"],
    ["0", ".", "="]
  ];

  return (
    <>
      <div>Display</div>
      {arr.map(nestedArray => (
        <div>
          {nestedArray.map(value => (
            <Number key={value} number={value} />
          ))}
        </div>
      ))}
    </>
  );
};

export default App;
